import React from 'react';
import './styles/global.css';
import './styles/pages/landing.css';
import LogoIMG from "./images/Logo.svg";
function App() {
  return (
    <div id="page-landing">
      <div className="content-wraper">

      <img src="LogoIMG" alt="" className="src"/>
      </div>
    </div>
  );
}

export default App;
